import React from 'react'

const ProductRow = ({product}) =>  {
    const color = product.stocked ? 'inherit' : 'red';
  
    return (
        <>
     
      <tr>
        <td><span style={color}>{product.name}</span></td>
        <td>{product.price}</td>
      </tr>
     
      </>
    );
  }
  

export default ProductRow
